import React from 'react';
import { Card, Grid, CardContent, CardMedia, Typography, Button } from '@mui/material';
import styled from 'styled-components'

const Container = styled.div`
display: flex;
flex-direction: column;
justify-content: center;
position: relative;
z-index: 1;
align-items: center;
`


const Wrapper = styled.div`
position: relative;
display: flex;
justify-content: space-between;
align-items: center;
flex-direction: column;
width: 100%;
max-width: 650px;
gap: 12px;
margin-bottom: 100px;
@media (max-width: 960px) {
    flex-direction: column;
}
`

export const Desc = styled.div`
    font-size: 18px;
    text-align: center;
    max-width: 600px;
    margin-bottom: 20px;
    color: ${({ theme }) => theme.text_secondary};
    @media (max-width: 768px) {
        font-size: 16px;
    }
`;

const Title = styled.h2`
  font-size: 28px;
  font-weight: 600;
  color: ${({ theme }) => theme.text_secondary};
  margin-bottom: 20px;
  text-align: center;
`

const box = styled.div`
  width: 100%;
  max-width: 500px;
  background: ${({ theme }) => theme.card};
  border: 0.1px solid #854CE6;
  box-shadow: rgba(23, 92, 230, 0.15) 0px 4px 24px;
  border-radius: 16px;
  padding: 18px 36px;
  @media (max-width: 768px) {
    max-width: 400px;
    padding: 10px 36px;
  }
  @media (max-width: 500px) {
    max-width: 330px;
    padding: 10px 36px;
  }

`

const Other = () => {
  return (
    <Container>
        <Wrapper>
    <Grid container spacing={8} align= "center" >

      {/* First Card */}
      <Grid item>

        <Card style={{ maxWidth: '18rem' } }>
          <CardMedia
            component="img"
            alt="Placeholder image"
            height="180"
            image="https://upload.wikimedia.org/wikipedia/commons/1/19/LeetCode_logo_black.png"
          />
          <box>
          <CardContent >

            <Title>
              LeetCode
            </Title>
            <Desc>
            I find fulfillment in tackling problem-solving challenges, particularly those related to Data Structures and Algorithms. I've successfully solved over 150 problems on LeetCode, and I am dedicated to actively contributing to the LeetCode community.
            </Desc>
            <Button variant="contained" >
              Go somewhere
            </Button>
          </CardContent>
          </box>
        </Card>
      </Grid>


      {/* Second Card */}
      <Grid item>
        <Card style={{ maxWidth: '18rem' }}>
          <CardMedia
            component="img"
            alt="Placeholder image"
            height="180"
            image="https://via.placeholder.com/180"
          />
          <CardContent>
            <Typography variant="h5" component="div">
              Card Title 2
            </Typography>
            <Typography variant="body2" color="text.secondary">
              Some quick example text for the second card.
            </Typography>
            <Button variant="contained" color="primary">
              Go somewhere
            </Button>
          </CardContent>
        </Card>
      </Grid>
    </Grid>
    </Wrapper>
    </Container>
  );
};

export default Other;
